import React from 'react';
import AdvancedChat from './AdvancedChat';
import BasicChat from './BasicChat';
import ReportAssistant from './ReportAssistant';

const containerStyle = {
  background: 'linear-gradient(135deg, #f0f4ff, #e8f7f6)',
  minHeight: '100vh',
  padding: '3rem 1rem',
  fontFamily: "'Segoe UI', sans-serif",
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
};

const headingStyle = {
  textAlign: 'center',
  color: '#2c3e50',
  marginBottom: '2.5rem',
  fontSize: '2.5rem',
  fontWeight: '700',
  letterSpacing: '1px',
};

const cardContainerStyle = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fit, minmax(320px, 1fr))',
  gap: '2rem',
  width: '100%',
  maxWidth: '1200px',
};

const cardStyle = {
  background: '#fff',
  borderRadius: '16px',
  boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
  padding: '2rem',
  textAlign: 'center',
  transition: 'transform 0.2s ease, box-shadow 0.2s ease',
};

const cardHoverStyle = {
  transform: 'translateY(-6px)',
  boxShadow: '0 8px 20px rgba(0,0,0,0.12)',
};

const footerStyle = {
  textAlign: 'center',
  color: '#666',
  marginTop: '3rem',
  fontSize: '0.9rem',
};

function App() {
  return (
    <div style={containerStyle}>
      <h1 style={{ ...headingStyle, marginBottom: '2rem' }}>MediBot Report Assistant</h1>
      <div style={{
        margin: '0 auto',
        maxWidth: '900px',
        width: '100%',
        background: '#fff',
        borderRadius: '18px',
        boxShadow: '0 6px 24px rgba(0,0,0,0.10)',
        padding: '2.5rem',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      }}>
        <iframe
          src="http://localhost:5006/report_assisstant"
          title="Report Assistant Panel"
          style={{ width: '100%', height: '700px', border: 'none', borderRadius: '14px', boxShadow: '0 2px 8px rgba(0,0,0,0.08)' }}
        />
      </div>
      <footer style={footerStyle}>
        &copy; 2025 MediBot. All rights reserved.
      </footer>
    </div>
  );
}

export default App;
